sources.style.css:
/*--------------
-----Banner-----
--------------*/
.banner-section {
  position: relative;
  margin-top: -30px;
}
.banner-section::before {
  content: "";
  position: absolute;
  bottom: -30px;
  left: 0;
  width: 70vw;
  height: 60px;
  background-color: #51c0a8;
  border-radius: 0 0 20px 0;
  z-index: 999;
}
#bannerSlider .carousel-caption {
  top: 100px !important;
  bottom: unset !important;
}
#bannerSlider .carousel-control-prev-icon {
  background-image: url("../images/prev-icon.png") !important;
  background-size: auto;
  background-repeat: no-repeat;
}
#bannerSlider .carousel-control-next-icon {
  background-image: url("../images/next-icon.png") !important;
  background-size: auto;
  background-repeat: no-repeat;
}
#bannerSlider .banner-content {
  max-width: 650px;
}
#bannerSlider .banner-slide {
  width: 100%;
  height: 730px;
}
#bannerSlider .banner-slide img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}
.banner-content h3 {
  font-weight: 500;
  font-size: 40px;
  line-height: 45px;
  color: #51c0a8;
  text-transform: capitalize;
}
.banner-content h2 {
  font-weight: 700;
  font-size: 50px;
  line-height: 55px;
  color: #ffffff;
}
.banner-content p {
  font-size: 16px;
  line-height: 20px;
  color: #ffffff;
  margin-top: 30px;
  text-transform: capitalize;
  padding-right: 20px;
}
.banner-btn-box {
  margin-top: 30px;
  display: flex;
  flex-direction: row;
}
.banner-btn-box a {
  z-index: 9999 !important;
}
.banner-btn-box .green-btn i {
  font-size: 18px;
}
.banner-btn-box .white-btn {
  margin-left: 30px;
}
.from-section {
  position: absolute;
  top: 60px;
  left: 0;
  right: 0;
  z-index: 1;
}
.from-section .form-container {
  max-width: 420px;
  padding: 0;
  transform: translateX(200%);
  z-index: 999;
  transition: all 350ms ease-in-out;
  animation: form_up 500ms ease-in-out 2s forwards;
  background-color: #ffffff10;
  backdrop-filter: blur(4px);
}
.from-section .form-container .form-box {
  background-color: transparent;
}
.from-section .form-box form .field-box {
  margin: 7px 0;
}
.from-section .form-container .span-heading {
  margin-bottom: 0;
  padding: 30px 20px 0 20px;
  color: #ffffff;
}
.from-section .form-box form .field-box {
  padding: 0 20px !important;
}
.from-section .form-box form .field-box:last-child {
  padding: 0 !important;
  margin-top: 50px !important;
  margin-bottom: 0 !important;
}
.from-section .form-box form .field-box input,
.from-section .form-box form .field-box textarea {
  padding: 12px 20px;
}
.from-section .form-box form .field-box textarea {
  max-height: 100px;
}
.from-section .form-box form .field-box input[type="submit"] {
  padding: 15px;
}
@keyframes form_up {
  0% {
    transform: translateX(200%);
  }
  100% {
    transform: translateX(0);
  }
}
/*------------
-----Form-----
------------*/
.form-container {
  padding: 30px 35px;
  background-color: #ffffff;
  border-radius: 0;
  max-width: 580px;
}
.form-container .span-heading {
  font-size: 30px;
  margin-bottom: 20px;
  font-weight: 700 !important;
}
.form-box {
  background-color: #ffffff;
  position: relative;
}
.form-box .form-btn-box {
  position: absolute;
  top: -60px;
  right: 20px;
}
.form-box .form-btn-box span {
  display: block;
  color: #ffffff;
  font-size: 20px;
  font-family: "Poppins", sans-serif;
  font-weight: 600;
  cursor: pointer;
}
.form-box form {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: flex-start;
}
.contact .form-btn-box,
.inner-service-sec-2 .form-btn-box {
  display: none;
}
.form-box form .field-box {
  width: 100%;
  margin: 10px 0;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
}
.form-box form .field-box label {
  font-family: "Roboto", sans-serif;
  font-size: 18px;
  font-weight: 500;
  color: #ffffff;
  margin-bottom: 5px;
  width: 100%;
}
.form-box form .field-box input::placeholder,
.form-box form .field-box textarea::placeholder {
  color: #434343;
}
.form-box form .field-box input,
.form-box form .field-box textarea {
  background-color: #f2faf840;
  color: #ffffff;
  font-family: "Roboto", sans-serif;
  font-size: 14px;
  cursor: default;
  border-radius: 0px;
  width: 100%;
  padding: 12px 20px;
  border: none !important;
  outline: none !important;
  box-shadow: none !important;
}
.form-box form .field-box.w50 input {
  width: calc(50% - 10px);
}
.form-box form .field-box input[type="submit"] {
  background: linear-gradient(90deg, #57D0AF, #57D0AF);
  color: #ffffff;
  font-family: "Inter", sans-serif;
  font-size: 15px;
  font-weight: 600;
  cursor: pointer;
  transition: all 350ms ease-in-out;
}
.form-box form .field-box input[type="submit"]:hover {
  letter-spacing: 2px;
}
@media (max-width: 575px) {
  .form-container {
    padding: 25px 20px;
  }
  .form-container .span-heading {
    margin-bottom: 10px;
  }
  .form-box form .field-box.w50 input {
    width: 100%;
    margin-bottom: 10px;
  }
  .form-box form .field-box.w50 input:last-child {
    margin-bottom: unset;
  }
  .form-box form .field-box label,
  .form-box form .field-box input,
  .form-box form .field-box textarea {
    font-size: 16px;
  }
}
@media (max-width: 425px) {
  #bannerSlider .banner-slide {
    height: 650px;
  }
  #bannerSlider .carousel-control-prev,
  #bannerSlider .carousel-control-next {
    display: none;
  }
}
/*----------------------
-----HOME SECTION 1-----
----------------------*/
.sec-1 {
  padding: 120px 0 90px 0;
  position: relative;
}
.sec-1 .car-box {
  position: absolute;
  bottom: 150px;
}
.sec-1 .content-box h3 {
  font-family: "Inter", sans-serif;
  font-size: 20;
  color: #57D0AF;
}
.sec-1 .content-box h2 {
  margin-bottom: 30px;
}
.sec-1 .content-box p {
  color: #3e3e3e;
}
.sec-1 .content-box .list-box-container {
  margin-top: 30px;
}
.sec-1 .list-box {
  margin-bottom: 10px;
}
.sec-1 .list-box .icon-box {
  margin-right: 10px;
}
.sec-1 .list-box .text-box {
  font-size: 16px;
  font-weight: 500;
  color: #000000;
}
.sec-1 .content-box .purple-btn {
  margin-top: 40px;
  width: 200px;
}
/*----------------------
-----HOME SECTION 2-----
----------------------*/
.sec-2 {
  padding: 130px 0;
  background-color: #f2faf8;
}
.brand-container {
  position: relative;
}
.sec-2 .brand-box {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  animation: fade 350ms ease-in-out;
}
.sec-2 .brand-box .brand-img {
  margin: 0 3vw;
}
.sec-2 .brand-box .brand-img img {
  height: 75px !important;
  width: auto !important;
}
.sec-2 .brand-box a {
  display: block;
  cursor: pointer;
}
.sec-2 .brand-indicator-box {
  position: absolute;
  left: 0;
  top: 20%;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  width: 100%;
}
.sec-2 .brand-indicator-box .prev-box,
.sec-2 .brand-indicator-box .next-box {
  height: 60px;
  width: 60px;
  border-radius: 50%;
  box-shadow: 0 4px 26px #03989e50;
  padding-left: 20px;
  padding-top: 17px;
  cursor: pointer;
}
.sec-2 .brand-indicator-box .next-box {
  background-color: #51c0a8;
  padding-left: 25px;
  padding-top: 17px;
}
@keyframes fade {
  from {
    opacity: 0.4;
  }
  to {
    opacity: 1;
  }
}
/*----------------------
-----HOME SECTION 3-----
----------------------*/
.service-sec {
  padding: 90px 0 145px 0;
  background-color: #f3f0f0;
}
.service-sec .content-box {
  max-width: 775px;
  margin: 0 auto;
  text-align: center;
}
.service-sec .content-box p {
  max-width: 570px;
  margin: 30px auto 0 auto;
}
.service-sec .service-row {
  margin-top: 60px;
}
.service-sec .service-box {
  padding: 0;
  margin: 0 auto 70px auto;
  background-color: #ffffff;
  box-shadow: 6px 6px 6px #00000020;
  text-align: center;
  position: relative;
  max-width: 380px;
}
.service-sec .service-box .img-box {
  width: 100%;
}
.service-sec .service-box .content-box {
  padding: 20px 15px;
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
.service-sec .service-box h3 {
  font-family: "Inter", sans-serif;
  font-size: 20px;
  font-weight: 700;
  color: #ffffff;
  margin-bottom: 20px;
}
.service-sec .service-box .icon-box {
  width: 90px;
  height: 65px;
  margin-bottom: 40px;
  background-color: #51c0a8;
  padding: 10px 0;
}
.service-sec .service-box .content-box:hover .icon-box {
  background-color: #2c307d;
}
.service-sec .service-box .service-link {
  display: block;
  font-family: "Inter", sans-serif;
  font-size: 14px;
  color: #ffffff;
  text-transform: capitalize;
  text-decoration: none;
}
.service-sec .service-box .service-link img {
  margin-top: -3px;
  margin-left: 7px;
}
.service-sec .service-box .content-box:hover .service-link img {
  filter: brightness(10);
}
/*---------------------------
-----Testimonial Section-----
---------------------------*/
.testimonial-sec {
  padding: 75px 0 285px 0;
  background-color: #f2faf8;
}
.testimonial-sec .content-box {
  max-width: 750px;
  text-align: center;
  margin: 0 auto;
}
.testimonial-container {
  margin: 60px auto 0 auto;
  position: relative;
}
.testimonial-box {
  position: relative;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  align-items: center;
  /*animation: fade 350ms ease-in-out;*/
  max-width: 954px;
  margin: 0 auto;
  background-color: transparent;
  overflow-x: clip;
  z-index: 0;
}
.testimonial-box::before {
  content: "";
  background-color: #ffffff;
  height: 130px;
  width: 130px;
  position: absolute;
  bottom: -65px;
  left: -65px;
  transform: rotate(45deg);
  z-index: 1;
}
.testimonial-box .text-box {
  background-color: #ffffff;
  padding: 195px 15px 100px 15px;
  border-radius: 0px;
  width: 100%;
  height: 400px;
}
.testimonial-box .text-box::before {
  content: "";
  background: #51c0a8;
  height: 20px;
  width: 100%;
  position: absolute;
  bottom: -20px;
  left: 20px;
}
.testimonial-box .text-box::after {
  content: "";
  background: #2c307d;
  height: 100%;
  width: 20px;
  position: absolute;
  top: 0;
